import { Box, TextField,Input, makeStyles, Button, Typography, InputAdornment, IconButton } from '@material-ui/core'
import { Visibility, VisibilityOff } from '@material-ui/icons'
import { useState } from 'react';

const useStyles = makeStyles((theme) => ({
    box: {
        textAlign: 'center',
        marginTop: '-140px',
        display: 'flex',
        flexDirection: 'column',
        background: 'white',
        borderRadius: '10px',
        border: '5px solid #fafafa',
        [theme.breakpoints.down('sm')]: {
            width: '60%',
        },
    },
    title: {
        marginBottom: '20px'
    },
    input: {
        marginBottom: '10px',
    },
}));


const Login = () => {

    const [showPassword, setShowPassword] = useState<boolean>(false);

    const handleClickShowPassword = () => {
        setShowPassword(!showPassword);
    };

    const handleMouseDownPassword = (event: React.MouseEvent<HTMLButtonElement>) => {
        event.preventDefault();
    };

    const classes = useStyles();

    return (
        <Box className={classes.box} p={5} width="25%">

            <Typography className={classes.title} variant="h4">Register</Typography>
            <TextField id="outlined-basic" label="Full Name" variant="outlined" className={classes.input} />
            <TextField id="outlined-basic" label="Email" variant="outlined" className={classes.input} />
            <TextField id="outlined-basic" label="Password" variant="outlined" type="password" className={classes.input} 
                InputProps={{
                    endAdornment:(
                    <InputAdornment position="end">
                        <IconButton
                        aria-label="toggle password visibility"
                        onClick={handleClickShowPassword}
                        onMouseDown={handleMouseDownPassword}
                        >
                        {showPassword ? <Visibility /> : <VisibilityOff />}
                        </IconButton>
                    </InputAdornment>
                    )
                }}
            />
            <TextField id="outlined-basic" label="Confirm Password" type="password" variant="outlined" className={classes.input}
             endAdornment={
              <InputAdornment position="end">
                <IconButton
                  aria-label="toggle password visibility"
                  onClick={handleClickShowPassword}
                  onMouseDown={handleMouseDownPassword}
                >
                  {showPassword ? <Visibility /> : <VisibilityOff />}
                </IconButton>
              </InputAdornment>
            } />
            <Button variant="contained" color="primary" style={{ marginTop: '20px' }}>Submit</Button>

        </Box>
    )
}

export default Login
